import requests
from requests.exceptions import HTTPError
from bs4 import BeautifulSoup
import csv

conteudo = None
URL = "https://github.com/trending"
URL2 = "https://github.com/robots.txt"

try:
  resposta = requests.get(URL)
  resposta.raise_for_status()
except HTTPError as exc:
  print(exc)
else:
  conteudo = resposta.text

# Parsing do conteúdo da página com BeautifulSoup
pagina = BeautifulSoup(conteudo, 'html.parser')

# Selecionando os projetos na página
projetos = pagina.find_all('article', class_='Box-row')[:10]  # Pegar apenas os 10 primeiros projetos

# Lista para armazenar os dados extraídos
dados = []

# Extraindo os detalhes de cada projeto
for ranking, projeto in enumerate(projetos, start=1):
    # Nome do projeto (formato: autor/repositório)
    titulo_elemento = projeto.h1
    titulo = titulo_elemento.a.text.strip().replace('\n', '').replace(' ', '') if titulo_elemento and titulo_elemento.a else "N/A"

    # Linguagem (se disponível)
    linguagem = projeto.find('span', class_='d-inline-block ml-0 mr-3')
    linguagem = linguagem.text.strip() if linguagem else "N/A"

    # Estrelas totais
    estrelas = projeto.find('a', href=lambda href: href and href.endswith('/stargazers'))
    estrelas = estrelas.text.strip().replace(',', '') if estrelas else "0"

    # Estrelas hoje
    estrelas_hoje = projeto.find('span', class_='d-inline-block float-sm-right')
    estrelas_hoje = estrelas_hoje.text.strip().replace('stars today', '').strip() if estrelas_hoje else "0"

    # Forks
    forks = projeto.find_all('a', href=lambda href: href and '/network/members' in href)
    forks = forks[0].text.strip().replace(',', '') if forks else "0"

    # Adicionando os dados na lista
    dados.append([ranking, titulo, linguagem, estrelas, estrelas_hoje, forks])

# Salvando os dados no arquivo CSV
with open('github.csv', mode='w', newline='', encoding='utf-8') as arquivo_csv:
    escritor_csv = csv.writer(arquivo_csv, delimiter=';')
    # Cabeçalho do CSV
    escritor_csv.writerow(['ranking', 'project', 'language', 'stars', 'stars_today', 'forks'])

    escritor_csv.writerows(dados)

print("Arquivo 'github.csv' criado com sucesso!")

